import React from 'react';

function About() {
  return (
    <section id="about" className="about">
      <h2>À propos de moi</h2>
      <div className="about-content">
        <p>Je suis actuellement en formation BTS SIO (Services Informatiques aux Organisations) 
           option SLAM (Solutions Logicielles et Applications Métiers) à [Nom de votre école].</p>
        <p>Mon parcours m'a permis d'acquérir des compétences en développement web et en 
           programmation orientée objet. Je suis particulièrement intéressé par le développement 
           d'applications web et mobiles.</p>
      </div>
    </section>
  );
}

export default About;
